import { PageRoutes } from "./types";
import products from "products";

const product = products.filter((prod) =>
	console.log(prod._vendorСode, "pageRoutes")
);

console.log(product, "pageRoutesproduct");

export const pageRoutes: PageRoutes = {
	MAIN_PAGE: "/main",
	CATALOG: "/catalog",
	CONTACTS: "/contacts",
	DELIVERY: "/delivery",
	STORES: "/stores",
	CARD_PRODUCT: `/product/cardProduct/${product}`,
	SHOPPING_CART: "/cart",
	PAYMENT: "/payment",
	NOT_FOUND: "/notFoundPage",
	FAVORITES: "/favorites",
	ERROR: "/error",
};

console.log(pageRoutes.CARD_PRODUCT, "pageRoutes");
